import React from 'react';

const Card = (dish) => {
    return (
        <div className='div-card'>
            <h2>{dish.name}</h2>
            <p>Origin : {dish.origin}</p>
            <img src={dish.picture} alt="fcvghbjn" />
            <p>{dish.description}</p>
        </div>
    );
};

export default Card;
